import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <h1>Home Page</h1>
            <nav>
                <ul>
                    <li><Link to="/generate-recipe">Generate Recipe</Link></li>
                    <li><Link to="/view-recipes">View Recipes</Link></li>
                </ul>
            </nav>
        </div>
    );
}

export default Home;
